import React from "react";

function Form(props) {
    return (
      <div>
        <input placeholder="First Name" 
        value={props.firstName}
        onChange={props.handleChange}
        name="firstName"
        />

        <input placeholder="Last Name" 
        value={props.state.lastName}
        onChange={props.handleChange}
        name="lastName"
        />

        <p>{props.state.firstName} {props.state.lastName}</p>
      </div>
    );
}

export default Form;
